import React, { useEffect } from "react";

export default function Dropdown2(props) {
  return (
    <div>
      <label for={props.name}>{props.label}</label>
      <input
        list={props.list}
        id={props.name}
        name={props.name}
      />
      <datalist id={props.list}>
      {props.mapItem.map((item,index)=>{
          return <option value={item} />;
      })}
      </datalist>
    </div>
  );
}
